import React, { useState } from 'react';
import './App.css';
//import $ from 'jquery';

const App = () => {
  const [content, setContent] = useState ( "paasivu" );
  return (
    <article className="App">
      <Header/>
      <Navigation/>
    </article>
  );
}

const Header = () => {
  const joukkue = "Huutoniemen Hoki";
  const lyhenne = "HH";
  return (
      <header className="App-header">
        <p>{lyhenne}</p>
        <h1>{joukkue}</h1>
      </header>
  );
}

const Navigation = () => {
  const setActive = (event) => {

    console.log(event.target.id);
  }
  return (
      <nav className="App-nav">
        <ul>
          <li id="paasivu" className="active" onClick={setActive}>Pääsivu</li>
          <li id="ottelut" onClick={setActive}>Ottelut</li>
          <li id="harjoitukset" onClick={setActive}>Harjoitukset</li>
          <li id="pelaajat" onClick={setActive}>Pelaajat</li>
          <li id="tilastot" onClick={setActive}>Tilastot</li>
        </ul>
      </nav>
  );
}

export default App;
